script: |
  super -f text -I q9544.spq | sort > q9544.out

inputs:
  - name: q9544.spq
    data: |
      SELECT ALL - col0 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT ( - col2 ) BETWEEN ( NULL ) AND - 54 + - col0;
  - name: tab2

outputs:
  - name: q9544.out
    data: |
      -46
      -64
      -75
